import React from 'react';
import { Card, CardContent, CardFooter } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { MapPin, Calendar, User, Star } from 'lucide-react';

interface PackageItemProps {
  image: string;
  location: string;
  duration: string;
  persons: number;
  price: string;
  title: string;
  description: string;
}

const PackageItem: React.FC<PackageItemProps> = ({
  image,
  location,
  duration,
  persons,
  price,
  title,
  description,
}) => (
  <Card className="packages-item">
    <div className="packages-img relative">
      <img
        src={image}
        className="w-full h-48 object-cover rounded-t-lg"
        alt={title}
      />
      <div className="packages-info absolute bottom-0 left-0 w-full flex text-xs bg-white/80 border-t border-b">
        <span className="flex-1 text-center border-r py-2">
          <MapPin className="inline-block w-4 h-4 mr-1" />
          {location}
        </span>
        <span className="flex-1 text-center border-r py-2">
          <Calendar className="inline-block w-4 h-4 mr-1" />
          {duration}
        </span>
        <span className="flex-1 text-center py-2">
          <User className="inline-block w-4 h-4 mr-1" />
          {persons} Person
        </span>
      </div>
      <div className="packages-price absolute top-0 right-0 bg-primary text-white py-1 px-3 rounded-bl-lg">
        {price}
      </div>
    </div>
    <CardContent className="p-4 bg-light">
      <h5 className="text-lg font-semibold mb-1">{title}</h5>
      <p className="text-xs uppercase text-muted-foreground mb-2">Hotel Deals</p>
      <div className="mb-3 flex">
        {[...Array(5)].map((_, i) => (
          <Star key={i} className="w-4 h-4 text-primary fill-current" />
        ))}
      </div>
      <p className="text-sm text-muted-foreground mb-4">{description}</p>
    </CardContent>
    <CardFooter className="bg-primary rounded-b-lg p-0">
      <Button variant="ghost" className="flex-1 text-white hover:bg-primary-foreground/10">
        Read More
      </Button>
      <Button variant="ghost" className="flex-1 text-white hover:bg-primary-foreground/10">
        Book Now
      </Button>
    </CardFooter>
  </Card>
);

export default function Packages() {
  const packages: PackageItemProps[] = [
    {
      image: "/placeholder.svg?height=300&width=400",
      location: "Venice - Italy",
      duration: "3 days",
      persons: 2,
      price: "$349.00",
      title: "Venice - Italy",
      description: "Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nesciunt nemo quia quae illum aperiam fugiat voluptatem repellat",
    },
    {
      image: "/placeholder.svg?height=300&width=400",
      location: "California - USA",
      duration: "3 days",
      persons: 2,
      price: "$449.00",
      title: "The New California",
      description: "Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nesciunt nemo quia quae illum aperiam fugiat voluptatem repellat",
    },
    {
      image: "/placeholder.svg?height=300&width=400",
      location: "Japan",
      duration: "3 days",
      persons: 2,
      price: "$549.00",
      title: "Discover Japan",
      description: "Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nesciunt nemo quia quae illum aperiam fugiat voluptatem repellat",
    },
    {
      image: "/placeholder.svg?height=300&width=400",
      location: "Thailand",
      duration: "3 days",
      persons: 2,
      price: "$649.00",
      title: "Thailand Trip",
      description: "Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nesciunt nemo quia quae illum aperiam fugiat voluptatem repellat",
    },
  ];

  return (
    <div className="bg-background py-12">
      <div className="container mx-auto px-4">
        <div className="text-center mb-10 max-w-3xl mx-auto">
          <h5 className="text-primary font-semibold mb-2">Packages</h5>
          <h1 className="text-4xl font-bold">Awesome Packages</h1>
        </div>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {packages.map((pkg, index) => (
            <PackageItem key={index} {...pkg} />
          ))}
        </div>
      </div>
    </div>
  );
}
